export default function timelineReducer(state = {destinations: [], addedDestinations: [], timelineData: []}, action) {
    switch (action.type) {
      case "FETCH_TIMELINE_DATA":
          return {...state, timelineData: action.payload}
      default:
          return state
    }
}
